function sortArray(arr, index, increase = true) {
    if (increase) {
        arr.sort(function (a, b) {
            if (a.child !== undefined)
                sortArray(a.child, index, increase);
            var valueA = a[index].value;
            var valueB = b[index].value;
            if (valueA === undefined)
                valueA = a[index];
            if (valueB === undefined)
                valueB = b[index];
            if (typeof valueA === "string")
                valueA = valueA.toLowerCase();
            if (typeof valueB === "string")
                valueB = valueB.toLowerCase();
            if (valueA > valueB)
                return -1;
            if (valueA < valueB)
                return 1;
            return 0;
        })
        if (arr.length !== 0)
            if (arr[arr.length - 1].child !== undefined) {
                sortArray(arr[arr.length - 1].child, index, increase);
            }
    }
    else {
        arr.sort(function (a, b) {
            if (a.child !== undefined)
                sortArray(a.child, index, increase);
            var valueA = a[index].value;
            var valueB = b[index].value;
            if (valueA === undefined)
                valueA = a[index];
            if (valueB === undefined)
                valueB = b[index];
            if (typeof valueA === "string")
                valueA = valueA.toLowerCase();
            if (typeof valueB === "string")
                valueB = valueB.toLowerCase();
            if (valueA < valueB)
                return -1;
            if (valueA > valueB)
                return 1;
            return 0;
        })
        if (arr.length !== 0)
            if (arr[arr.length - 1].child !== undefined) {
                sortArray(arr[arr.length - 1].child, index, increase);
            }
    }
}

function getDate() {
    var today = new Date();
    var dd = String(today.getDate()).padStart(2, '0');
    var mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
    var yyyy = today.getFullYear();

    today = dd + '/' + mm + '/' + yyyy;
    return today;
}

function random_bg_color() {
    var x = Math.floor(Math.random() * 256);
    var y = Math.floor(Math.random() * 256);
    var z = Math.floor(Math.random() * 256);
    var bgColor = "rgb(" + x + "," + y + "," + z + ")";
    return bgColor;
}

function allowNumbersOnly(e) {
    var code = (e.which) ? e.which : e.keyCode;

    if ((code > 122 || code < 97) && code != 45) {
        e.preventDefault();
    }
}

function createAlias(string) {
    var value = ""
    string = string.toLowerCase();
    string = ModuleView_removeAccents(string);

    for (var i = 0; i < string.length; i++) {
        if (string[i] == " ") {
            value += "-";
            continue;
        }

        if ((string[i] > "z" || string[i] < "a") && string[i] != "-") {
            continue;
        }

        value += string[i];
    }
    return value.replace(/^\-+|\-+$/gm, '');;
}

function ModuleView_removeAccents(str) {
    return str.normalize('NFD')
        .replace(/[\u0300-\u036f]/g, '')
        .replace(/Ä‘/g, 'd').replace(/Ä/g, 'D');
}

